import http from '../http/http';

class Auth {
    constructor() {
        this.isAuthenticated = false;
        this.login = (username, password) => {
            http('GET', { 'authentication': 'bearer phillip' }, 'http://localhost:3000', { username, password }, (res) => {
                console.log(res);
            })
        }
        this.logout = () => {

        }
    }
}

export default new Auth();
